import React from 'react';

function Card({cardContent}) {
  return(
    <a className={cardContent.className} href={cardContent.href} key={cardContent.key}>
      <p>{cardContent.description}</p>
      <img src={require(cardContent.imgSrc)} alt={cardContent.alt}/>
    </a>
  );
}

export default Card;
